    function displayTime(targetEle, t = null) {
        let timeString = '';
        if (null === t) {
            let timezone = 8; //ÁõÆÊ†áÊó∂Âå∫Êó∂Èó¥Ôºå‰∏úÂÖ´Âå∫
            let now = new Date(new Date().getTime() + new Date().getTimezoneOffset() * 60 * 1000 + timezone * 60 * 60 * 1000);
            let hours = now.getHours();
            let minutes = now.getMinutes();
            timeString = `${(hours + '').length > 1 ? hours : '0' + hours}:${(minutes + '').length > 1 ? minutes : '0' + minutes}`;
        } else {
            timeString = '';
        }
        if(targetEle.innerText != timeString)
            targetEle.innerText = timeString;
    }
